    function getEBT(V, F, P, R)
    {
        var typeOfBag = V;
        var typeOfFlight = F;
        var typeOfPass = P;
        var typeOfReff = R;



        if (typeOfFlight == 'D')
        {
            if ($('#pric_edetail').val() == '')
            {
                $(".bag").val("");
                $(".bagReff").val("");
                $(".bagVal").val(0);
                swal('', 'Please choose departure flight');
                return false;
            }
        }



        if (typeOfFlight == 'R')
        {
        }

        var priceOfBag = 0;
        var totalPriceOfBag = 0;
        var ebtA = 0;
        var ebtC = 0;

        var adultBag = 0
        var childBag = 0
        var passOfBag = '';
        passOfBag = 'EBT_' + typeOfFlight + '_' + typeOfPass;
        var adult = 1;
        if (adult > 0)
        {
            if (typeOfPass == 'A')
            {
                ebtA = 0;
                priceOfBag = 0;
                adultBag = '';
                if ($("#ebtSelected").is(':checked'))
                {
                    var i;
                    for (i = 1; i <= adult; i++)
                    {
                        if ($('#' + passOfBag + i).val() == 'BAG05')
                        {
                            if (typeOfFlight == 'D')
